        type="text"
        name="input2"
        value={formData.input2}
        onChange={handleChange}
        placeholder="Input 2"
      />

      <input
        type="text"
        name="input1"
        value={formData.input1}
        onChange={handleChange}
        placeholder="Input 1"
      />
      <input
        type="text"
        name="input2"
        value={formData.input2}
        onChange={handleChange}
        placeholder="Input 2"
      />
      <input
        type="text"
        name="input1"
        value={formData.input1}
        onChange={handleChange}
        placeholder="Input 1"
      />
      <input
        type="text"
        name="input2"
        value={formData.input2}
        onChange={handleChange}
        placeholder="Input 2"
      />

      <button type="submit">Submit</button>
    </form>
  );
};

export default Invoice;
